  const[courses,setCourses]=useState()
  useEffect(
    ()=>{
      const fetchData=async()=>{
        try{
          const res=await fetch(apiUrl);
          const data=res.json();
          //save data into a variable
          console.log(data);
        }
        catch(error){
          toast.error("something went")
        }
      }
    }
  )
  return(
    <div>
      
      <Navbar></Navbar>
       <Filter filterData={filterData}/>

      <Cards/> 
      
    </div>
  );
   
};

